import Vue from 'vue';
import Router from 'vue-router';
import CreateDataComponent from './views/CreateDataComponent.vue'; 

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: '/create',
      name: 'CreateData', 
      component: CreateDataComponent, 
    },
  ],
});
